\title{Possible SU(3) Chiral Spin Liquid on the Kagome Lattice}

\author{Ying-Hai Wu}
\email{yinghai.wu@mpq.mpg.de}

\author{Hong-Hao Tu}
\email{hong-hao.tu@mpq.mpg.de}

\affiliation{Max-Planck-Institut f{\"u}r Quantenoptik, Hans-Kopfermann-Stra{\ss}e 1, 85748 Garching, Germany}

\date{\today}

\begin{abstract}
We propose an SU(3) symmetric Hamiltonian with short-range interactions on the Kagome lattice and show that it hosts an Abelian chiral spin liquid (CSL) state. We provide numerical evidence based on exact diagonalization to show that this CSL state is stabilized in an extended region of the parameter space and can be viewed as a lattice version of the Halperin 221 fractional quantum Hall (FQH) state of two-component bosons. We also construct a parton wave function for this CSL state and demonstrate that its variational energies are in good agreement with exact diagonalization results. The parton description further supports that the CSL is characterized by a chiral edge conformal field theory (CFT) of the SU(3)$_1$ Wess-Zumino-Witten type.
\end{abstract}
\maketitle

{\em Introduction} -- Topological aspects of condensed matter have been actively studied since the discovery of the quantum Hall effect. An important development in this area is the concept of topological order~\cite{wen2004}, which describes phases that can not be distinguished using the conventional symmetry breaking paradigm but exhibit exotic topological properties such as fractional charge, anyonic braiding statistics, and ground state degeneracy on high genus manifold. Besides the FQH states, it has long been speculated that there could be topologically ordered states in antiferromagnetic spin systems (called spin liquid) which do not break the crystalline symmetries or spin rotation symmetries. To suppress the tendency of forming magnetic orders, one should consider frustrated lattices in which no simple alignment of spins can achieve the lowest energy under antiferromagnetic exchange. The Kagome lattice has been very promising in this regard, and recent numerical and experimental studies indeed point to the existence of spin liquid states in certain systems~\cite{yan2011,han2012,jiang2012,depenbrock2012,he2014,gong2014,bauer2014}.

The theoretical study of strongly correlated spin systems is generally very difficult. Being motivated by the large $N$ expansion in gauge field theory, it has been proposed that one may investigate SU(N) spin systems using similar perturbative methods (organized in powers of $1/N$) to obtain some hints about the physics of SU(2) spins~\cite{arovas1988,affleck1988b,read1989,hermele2009}. One may worry that the perturbative results obtained in the large $N$ limit might not be applicable when $N$ is small, so other theoretical methods and numerical calculations are also essential in understanding the physics. Exactly solvable models, such as the Uimin-Lai-Sutherland model~\cite{uimin1970,lai1974,sutherland1975}, the Haldane-Shastry type models~\cite{haldane1988,shastry1988,kawakami1992,ha1992}, the Affleck-Kennedy-Lieb-Tasaki type models~\cite{affleck1987,affleck1991,chen2005,greiter2007a,greiter2007b,arovas2008}, have been designed and they provide useful insight into SU(N) spin systems. Another widely used method is to decompose the spins as bosonic or fermionic partons and build exotic spin states using mean field states of the partons and Gutzwiller projection. Based on different approaches, a rich variety of physical phenomena has been revealed in SU(N) spin systems~\cite{azaria1999,zhang2001,harada2003,corboz2011,bieri2012,honerkamp2004,cazalilla2009,gorshkov2010,manmana2011,nonne2013}.

It might appear at first sight that SU(N) spin systems are not relevant in experiments because the spins in solid state systems are almost all due to electrons so belong to the SU(2) group. However, it was proposed~\cite{li1998,yamashita1998} that the SU(4) Heisenberg model might describe certain materials in which SU(4) symmetry arise from coupled spin and orbital degrees of freedom~\cite{kugel1973}. There has also been substantial progress in experiments using cold atoms with several internal states, which brings SU(N) spin systems even closer to experimental reality~\cite{taie2010,taie2012,zhang2014,scazza2014}. The atomic species, lattice configurations, and the forms of interactions in cold atom experiments can be tuned in a wide range~\cite{bloch2008,cazalilla2014}, which would enable us to explore the rich physics associated with SU(N) spins.

The connection between FQH states and spin liquid was revealed in a seminal work by Kalmeyer and Laughlin~\cite{kalmeyer1987}, which demonstrated that bosonic FQH states can be mapped to spin states. In this example, one maps the spin-$1/2$ degree of freedom on a lattice site to a boson and impose the hard-core constraint such that there is at most one boson per site. This can be generalized to cases where the lattice sites have higher spins of the SU(2) group \cite{greiter2009}. We will explain below how to map SU(3) spins to bosons and establish a correspondence between SU(3) spin liquid and FQH states of two-component bosons.

Being equipped with the mapping between FQH and spin liquid states, we can use some techniques developed for FQH states to understand spin liquid. One fruitful way in the FQH context is to express FQH wave functions as chiral correlators of CFTs~\cite{moore1991,nielsen2012}. The advantage of this approach is that, by using CFT null field technique~\cite{nielsen2011}, it can give a parent Hamiltonian with the spin liquid as its exact ground state~\cite{nielsen2012,tu2013a,tu2014b,bondesan2014} (see Refs.~\cite{schroeter2007,greiter2014} for alternative ways of deriving parent Hamiltonians). However, these parent Hamiltonians usually contain long-range interactions. To be more realistic, it is of great importance to test where the spin liquid states can be stabilized using Hamiltonians consist of only simple short-range interactions~\cite{nielsen2013,glasser2015}.

{\em Mapping SU(3) Spins to Bosons} --- To make connections between SU(3) spin models and two-component FQH wave functions, we briefly review their properties. The generators of the SU(3) group are usually chosen to be the eight $3\times3$ Gell-Mann matrices $\lambda_i$ ($i=1,2,\cdots,8$). For a lattice where each site is described by the fundamental representation and the whole system is described by an SU(3) invariant Hamiltonian, the local Hilbert space dimension is three and there are two U(1) symmetries. To formulate a boson description, we may interpret the lattice as being occupied by two-component bosons (the two internal states are labeled as $\uparrow$ and $\downarrow$). Imposing the hard-core constraint that allows for at most one boson on each site results in a local Hilbert space dimension three ({\em i.e.} empty, one $\uparrow$ boson, and one $\downarrow$ boson). The two U(1) symmetries correspond to the particle number conservation of these two types of bosons.

The simplest FQH state of two-component bosons is the Halperin 221 state at filling factor $2/3$~\cite{halperin1983}
\begin{eqnarray}
\Psi_{221} = \prod^{M}_{s>t=1} (z^{\uparrow}_s-z^{\uparrow}_t)^2 (z^{\downarrow}_s-z^{\downarrow}_t)^2 \prod^{M}_{s,t=1} (z^{\uparrow}_s-z^{\downarrow}_t),
\end{eqnarray}
where $z=x+iy$ is the complex coordinate in two dimensions and the superscripts indicate the internal states. The low-energy properties of this state is encoded in the Chern-Simons theory with the Lagrangian
\begin{eqnarray}
{\mathcal L} = \frac{1}{4\pi} K_{IJ} \epsilon^{\mu\nu\rho} a^{I}_{\mu} \partial_\nu a^{J}_{\rho},
\end{eqnarray}
where $K_{IJ}$ is the $2\times2$ matrix
\begin{eqnarray}
\left(\begin{array}{cc}
2 & 1 \\
1 & 2
\end{array}\right)
\label{Kmatrix}
\end{eqnarray}
One characteristic signature of topologically ordered states, the ground state degeneracy on torus, can be deduced from this Chern-Simons theory as ${\rm det}K=3$. The Chern-Simons action also provides useful information about its edge physics: the $K$ matrix has two positive eigenvalues, so there are two copropagating edge modes described by $U(1){\times}U(1)$ bosons. For bosons in the lowest Landau level, this state is the exact ground state if there are only contact interactions $\sum_{\sigma\tau} \delta({\mathbf r}^\sigma-{\mathbf r}^\tau)$ between all the bosons regardless of their spins. The contact interaction forbids two bosons to appear at the same position, which is somewhat equivalent to the constraint of having at most one boson per site in the boson description of SU(3) spin systems. In general, the spin models defined on a lattice appear to be very different from the simple continuum model, but their low-energy effective theories are the same Chern-Simons. This can be seen from the parton construction of the SU(3) chiral spin liquid state (see below).

