{\em Exact Diagonalization} --- The CFT construction provides us parent Hamiltonians for which the SU(3) spin liquids are exact ground states~\cite{tu2014b,bondesan2014}. These Hamiltonians inevitably contain long-range terms but they provide useful hints about what kind of short-range Hamiltonians might have ground states in the same phase. A general Hamiltonian can be written in terms of the Gell-Mann matrices, but SU(3) invariance gives stringent constrains on the Hamiltonians and it is usually more convenient to express them in terms of swapping operators. For our purpose, we need to define two-body and three-body swapping operators $P_{st}$ and $Q_{rst}$. When $P_{st}$ is applied on a state, the spin states on the lattice sites $s$ and $t$ are exchanged. When $Q_{rst}$ is applied on a state, the spin states on lattice $r$, $s$ and $t$ are cyclically permuted in a counterclockwise way.

The short-range Hamiltonian we have tested consists of two-body terms acting on all nearest neighbors and three-body terms acting on all small triangles
\begin{eqnarray}
H &=& J \sum_{\langle{st}\rangle} P_{st} + (K_1 - i K_2) \sum_{\langle{rst}\rangle} Q_{rst} \nonumber \\
  &+& (K_1 + i K_2) \sum_{\langle{rst}\rangle} Q^{-1}_{rst},
  \label{eq:Hamiltonian}
\end{eqnarray}
where $Q^{-1}_{rst}$ means permuting the spin states clockwisely (equivalent to two counterclockwise permutations). In Fig.~\ref{Figure1}, we show a Kagome lattice with 18 sites ($3$ unit cells along one direction and $2$ unit cells along the other direction) as well as the terms in the Hamiltonian. The Hamiltonian~(\ref{eq:Hamiltonian}) is SU(3) invariant, so its eigenstates belong to definite representations of the SU(3) group. We impose periodic boundary conditions in both directions so the eigenstates also have good momentum quantum numbers. We choose $J=1$ as the energy scale and vary $K_{1,2}$ over a broad range to search for the optimal values that may stabilize a SU(3) chiral spin liquid. In the thermodynamic limit, the spin liquid state that we seek has three degenerate ground states but their energies generally split in finite size systems. To characterize the energy spectra quantitatively, we plot in Fig.~\ref{Figure2} the gap $E_{\rm gap}$ between the third state and the fourth state as well as the energy splitting $E_{\rm split}$ of the lowest three eigenstates. The first hint of the existence of a spin liquid is that $E_{\rm gap}$ is sufficiently large while $E_{\rm split}$ is small enough. One can see that this is indeed the case in a region around $K_1\approx0.6$ and $K_2\approx0.45$. It is also important to confirm that the three quasi-degenerate ground states are SU(3) singlets, which we have done by explicit calculations in several cases [including the two spectra shown in Fig.~\ref{Figure2} (a) and (b)]. Furthermore, it is found that the ground states occur in the $K_x=0$ and $K_y=0$ momentum sector. We have obtained similar results for the Kagome lattice with $12$ sites ($2$ unit cells along both directions).

\emph{Parton Wave Functions} --- To gain further insights into the nature of the ground states of the SU(3) Hamiltonian (\ref{eq:Hamiltonian}), we now resort to a parton wave function description of the numerically observed spin liquid phase. This relies on a fermionic representation of the SU(3) spins, where the three local states are encoded using singly occupied fermions, $|\alpha\rangle =c^{\dagger}_{\alpha}|0\rangle$ ($\alpha=1,2,3$). The redundant states in the fermionic Hilbert space are removed by a Gutzwiller projector $P_{\mathrm{G}}$ which locally enforce single occupancy on each site, {\em i.e.} $\sum_{\alpha}c^{\dagger}_{s\alpha}c_{s\alpha}=1$ $\forall s$.

We assume that the partons are described by the free fermion Hamiltonian

