\begin{equation}
H_{\rm parton} = \sum_{\alpha} \sum_{\langle{st}\rangle} f_{st} c^{\dagger}_{s\alpha} c_{t\alpha} - \mu \sum_{\alpha} \sum_{s} c^{\dagger}_{s\alpha} c_{s\alpha},
\label{eq:partonMF}
\end{equation}

