where $|\Psi _{\rm parton}\rangle $ is the Fermi sea ground state of~(\ref{eq:partonMF}).

For our purpose of describing the numerically observed CSL state, we choose the hopping integral $f_{st}$ in~(\ref{eq:partonMF}) to be complex numbers whose phases depend on only one parameter $\theta$ as shown in Fig.~\ref{Figure1}. The value of $\theta$ determines the fluxes in the triangles and hexagons of the Kagome lattice. With this prescription, the parton Hamiltonian~(\ref{eq:partonMF}) has three energy bands. As we are looking for an SU(3) singlet ansatz, the chemical potential is fixed so that only the lowest band is completely filled by fermionic partons.

\begin{figure}
\centering
\includegraphics[scale=0.42]{parton}
\caption{(Color online) (a) Variational energy of the parton trial state as a function of the parameter $\theta$. The lowest variational energies for the Hamiltonian~(\ref{eq:Hamiltonian}) with $K_1=0.6$, $K_2=0.4$ (green crosses) and $K_1=0.6$, $K_2=0.5$ (blue open circles) both appear at $\theta_{\rm min}\approx0.88\pi$. The gap between the lowest and the middle bands of the parton Hamiltonian vanishes at $\theta=\pi/4$ and $\theta=3\pi/4$ (denoted by two dotted lines). (b) Band structure of the parton Hamiltonian at the optimal variational point $\theta_{\rm min}$. The three bands are separated by energy gaps and have Chern numbers $-1$, $0$, and $+1$, respectively (from top to bottom).}
\label{fig:parton}
\end{figure}

To optimize the variational ansatz, we choose many different $\theta$ values and compute the energy of the wave function Eq.~(\ref{eq:partonWF}) with respect to the Hamiltonian (\ref{eq:Hamiltonian}) to select the one giving the lowest energy. This has been done in several cases on the lattice with 18 sites but we focus here on the following two sets of parameters, i) $K_{1}=0.6, K_{2}=0.4$ and ii) $K_{1}=0.6, K_{2}=0.5$. The variational energy as a function of $\theta$ is shown in Fig.~\ref{fig:parton} (a). The best results in the two cases, which both appear at $\theta_{\rm min}\approx0.88\pi$, are $-13.12$ for $K_{2}=0.4$ and $-14.08$ for $K_{2}=0.5$. They are quite close to the energies of the three quasi-degenerate ground states [see Fig.~\ref{Figure2} (a) and (b)].

For the optimal choice $\theta_{\rm min}$, the three parton energy bands of~(\ref{eq:partonMF}) have Chern numbers $-1$, $0$, $+1$, respectively [see Fig.~\ref{fig:parton}(b), from top to bottom]. This means that the parton trial wave function (\ref{eq:partonWF}) describes a Gutzwiller projected Chern insulator with Chern number $+1$. It should be emphasized that our parton wave function is constructed for partons obeying periodic boundary conditions. Based on previous experience \cite{zhang2012,tu2013b} of parton construction for chiral topological states, we expect that two more parton states can be obtained by choosing twisted boundary conditions for the partons. The existing one and these two more states provide a complete approximation of the ground state manifold.

Having determined that the SU(3) CLS state may be interpreted as Gutzwiller projected Chern insulator with Chern number $+1$, one can proceed to derive the low-energy effective theory for the CLS state using functional path integral. After integrating out the fermionic partons~\cite{lu2014,liu2014}, the resulting theory is just the Chern-Simons theory with the $K$ matrix given by Eq.~(\ref{Kmatrix}). This process further supports the claim that the SU(3) CSL state shares the same topological order as the Halperin 221 state.

{\em Conclusion and Discussion} --- In this Letter, we have investigated an SU(3) symmetric Hamiltonian consists of short-range interactions on the Kagome lattice. Based on exact diagonalization results, we have identified an extended region in the parameter space where system is an Abelian SU(3) CSL. A trial wave function constructed using fermionic partons and Gutzwiller projection is found to be a good approximation of the exact eigenstates obtained in numerical calculations. The low-energy effective theory is deduced based on an analogy with the Halperin 221 FQH states of two-component bosons as well as from the parton trial wave function and turns out to be the SU(3)$_1$ Chern-Simons theory. It has been shown in Ref.~\cite{sun2015} how to derive a Chern-Simons theory for SU(2) spin systems on arbitrary lattices, so one might expect that the Chern-Simons theory for the SU(3) CSL studied in this work can also be derived without reference to partons.

In general, one can establish a mapping between SU(N) spins and (N-1)-component bosons, which suggests that SU(N) CSL and FQH states of multi-component bosons are closely related. It would be very interesting if one can also identify short-range interactions in other SU(N) spin systems that can host CSL states. Another exciting direction opened by our current work is to investigate SU(N) CSL with non-Abelian anyons. The CFT construction of multi-component non-Abelian FQH states~\cite{ardonne1999,ardonne2001} is also a good starting point in this study. The relation between these non-Abelian spin-singlet (NASS) states and the Halperin 221 state is very much the same as that between the Moore-Read state and the Laughlin state. While the Kalmeyer-Laughlin state is designed for spin-$1/2$ systems, the lattice version of the Moore-Read state may be realized in spin-$1$ systems. It should be possible to reformulate the NASS states in SU(N) spin systems where the spins are described by higher-dimensional representation of the SU(N) group. It would also require numerics to test whether one can find sufficiently simple short-range microscopic Hamiltonians to stabilize these states.

